import React, { Profiler, useEffect } from 'react';
import './App.css';

const onRenderCallback = (
  id,
  phase,
  actualDuration,
  baseDuration,
  startTime,
  commitTime,
  interactions
) => {
  console.log({ id, phase, actualDuration, baseDuration, startTime, commitTime, interactions });
};

const simulateCPULoad = () => {
  // Simulate CPU intensive task for 5 seconds
  const end = Date.now() + 5000;
  while (Date.now() < end) {
    // Perform some dummy calculations to keep the CPU busy
    const x = Math.random() * Math.random();
    Math.sqrt(x);
  }
  console.log('Simulated CPU load for 5000ms');
};

const simulateLongTasks = () => {
  for (let i = 0; i < 5; i++) {
    const start = Date.now();
    while (Date.now() - start < 200) {
      // Simulating a long task for 200ms
    }
    console.log(`Long task ${i + 1} completed`);
  }
};

function App() {
  useEffect(() => {
    simulateCPULoad();
    simulateLongTasks();
  }, []);

  return (
    <Profiler id="App" onRender={onRenderCallback}>
      <div className="App">
        <header className="App-header">
          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>
        </header>
      </div>
    </Profiler>
  );
}

export default App;
